(function() {

    var renderer, scene, camera, ww, wh, particles;
    var centerVector = new THREE.Vector3(0,0,0);
    var imagedata;

    var imgData = "data:image/svg+xml;base64,"
    var image = document.createElement("img");
    image.src = imgData;
    ww = window.innerWidth,
    wh = window.innerHeight;

    speed = 10;
    var isMouseDown = false;
    var lastMousePos = {
        x: 0,
        y: 0
    };

    var getImageData = function(image) {

        var canvas = document.createElement("canvas");
        canvas.width = image.width;
        canvas.height = image.height;

        var ctx = canvas.getContext("2d");
        ctx.drawImage(image, 0, 0);

        return ctx.getImageData(0, 0, image.width, image.height);
    };

    function getPixel(imagedata, x, y) {
        var position = (x + imagedata.width * y) * 4
          , data = imagedata.data;
        return {
            r: data[position],
            g: data[position + 1],
            b: data[position + 2],
            a: data[position + 3]
        };
    }

    var drawTheMap = function() {
        var geometry = new THREE.Geometry();
        var material = new THREE.PointCloudMaterial();
        material.vertexColors = true;
        material.transparent = true;
        for (var y = 0, y2 = imagedata.height; y < y2; y += 1) {
            for (var x = 0, x2 = imagedata.width; x < x2; x += 1) {
                if (imagedata.data[x * 4 + y * 4 * imagedata.width] > 0) {

                    var vertex = new THREE.Vector3();
                    vertex.x = x - imagedata.width / 2 + 0.5;
                    vertex.y = -y + imagedata.height / 2 + 0.5;
                    vertex.z = -Math.random() * 500;

                    vertex.speed = Math.random() / speed + 0.015;

                    var pixelColor = getPixel(imagedata, x, y);
                    var color = "rgb(" + pixelColor.r + ", " + pixelColor.g + ", " + pixelColor.b + ")";
                    geometry.colors.push(new THREE.Color(color));
                    geometry.vertices.push(vertex);
                }
            }
        }
        particles = new THREE.Points(geometry,material);
        scene.add(particles);
        requestAnimationFrame(render);
    };

    var init = function() {
        renderer = new THREE.WebGLRenderer({
            canvas: document.getElementById("LOGO"),
            antialias: true,
            alpha: true
        });
        renderer.setSize(ww, wh);

        scene = new THREE.Scene();

        camera = new THREE.OrthographicCamera(ww / -2,ww / 2,wh / 2,wh / -2,1,1000);
        camera.position.set(0, 0, 300);
        camera.lookAt(centerVector);
        scene.add(camera);
        if (window.innerWidth < 360) {
            camera.zoom = 0.3;
        } else if (window.innerWidth < 450) {
            camera.zoom = 0.35;
        } else if (window.innerWidth < 700) {
            camera.zoom = 0.45;
        } else if (window.innerWidth < 1200) {
            camera.zoom = 0.6;
        } else {
            camera.zoom = 0.8;
        }
        camera.updateProjectionMatrix();

        imagedata = getImageData(image);
        if (imagedata) drawTheMap();

        window.addEventListener('mousemove', onMousemove, false);
        window.addEventListener('mousedown', onMousedown, false);
        window.addEventListener('mouseup', onMouseup, false);
        window.addEventListener('resize', onResize, false);
    };
    
    var onResize = function() {
        ww = window.innerWidth;
        wh = window.innerHeight;
        renderer.setSize(ww, wh);
        camera.left = ww / -2;
        camera.right = ww / 2;
        camera.top = wh / 2;
        camera.bottom = wh / -2;

        if (ww < 360) {
            camera.zoom = 0.3;
        } else if (ww < 450) {
            camera.zoom = 0.35;
        } else if (ww < 700) {
            camera.zoom = 0.45;
        } else if (ww < 1200) {
            camera.zoom = 0.6;
        } else {
            camera.zoom = 0.8;
        }
        camera.updateProjectionMatrix();
    };

    var onMouseup = function() {
        isMouseDown = false;
    };
    var onMousedown = function(e) {
        isMouseDown = true;
        lastMousePos = {
            x: e.clientX,
            y: e.clientY
        };
    };
    var onMousemove = function(e) {
        if (isMouseDown) {
            camera.position.x += (e.clientX - lastMousePos.x);
            camera.position.y -= (e.clientY - lastMousePos.y);
            camera.lookAt(centerVector);
            lastMousePos = {
                x: e.clientX,
                y: e.clientY
            };
        }
    };

    var render = function(a) {

        requestAnimationFrame(render);

        particles.geometry.verticesNeedUpdate = true;
        if (!isMouseDown) {
            camera.position.x += (0 - camera.position.x) * 0.06;
            camera.position.y += (0 - camera.position.y) * 0.06;
            camera.lookAt(centerVector);
        }

        renderer.render(scene, camera);
    };
    window.onload = function() {
        init();
    };

    var md = new MobileDetect(window.navigator.userAgent);

    function loadProject() {
        if (!md.mobile()) {
            init();
        }
    }
    ;
    loadProject();
}
)();
